import React, {Component} from 'react';
import './Channel.css';

class Channel extends Component {
	state = {
		channel: this.props.channel
	}

	render(){
		return(
			<li className={this.state.channel.active ? 'active' : '' } onClick={ () => this.props.selectChannel(this.state.channel.id) } >{this.state.channel.name}
			</li>
		)
	}
}

export default Channel;
